import Colors from '../constants/colors';


export default class index extends React.Component {

    static async getInitialProps() {
        return {}
    }

    render() {
        return (
            <div>
                <div className="mainContainer">
                    <div></div>
                </div>
                <style jsx>
                    {`
                        .mainContainer{
                            height: 200vh;
                            width: 100%;
                            background: white;
                            margin: 16px;
                        }
                        .navBar{
                            display: flex;
                            flexDirection: row;
                            height: 72px;
                            width: 100%;
                            background: ${Colors.transparentWhite};
                            alignItems: center;
                            justifyContent: center;
                            position: sticky;
                            top: 0;   
                        }
                        .logo{
                            color: rgba(255,255,255,0.9);
                            margin-left: 4rem;
                            
                        }
                  `}
                </style>

                <style global jsx>
                    {`
                        body {
                            background:white;
                            margin: 0;
                            padding: 0;
                            border: 0;
                        }
                       
                    `}
                </style>

            </div>
        )

    }



}
